  `kondisi_areal` varchar(4) DEFAULT NULL,
  `kode_varietas` varchar(4) DEFAULT NULL COMMENT 'BLL\r\n',
  `gis_id` varchar(20) DEFAULT NULL,
  `total_pokok_produktif` double DEFAULT NULL,
  `jarak_blok_ke_pabrik` double DEFAULT NULL,
  `jml_batang_juring` double DEFAULT NULL,
  `jml_juring_ha` double DEFAULT NULL,
  `taksasi_pandang` double DEFAULT NULL,
  `berat_per_m` double DEFAULT NULL,
  `rata_tgi_batang` double DEFAULT NULL,
  `aff_tebang` smallint(1) DEFAULT '0' COMMENT '1. aff 0. belum',
  `spt_status` smallint(1) DEFAULT '0',
  `spt_tgl` datetime DEFAULT NULL,
  PRIMARY KEY (`id_field`,`kode_blok`) USING BTREE,
  UNIQUE KEY `FK` (`kode_blok`) USING BTREE
