/*Table structure for table `t_spta` */

DROP TABLE IF EXISTS `t_spta`;

CREATE TABLE `t_spta` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `no_spat` varchar(50) NOT NULL DEFAULT '' COMMENT 'no spat',
  `kode_plant` varchar(5) DEFAULT NULL COMMENT 'kode pabrik gula pembuat spta',
  `kode_blok` varchar(20) NOT NULL DEFAULT '' COMMENT 'kode sap',
  `tgl_spta` date DEFAULT NULL COMMENT 'tgl spta di buat',
  `tgl_expired` datetime DEFAULT NULL COMMENT 'tgl akhir masa berlaku spta',
  `tgl_cetak` datetime DEFAULT NULL COMMENT 'tgl_cetak spta',
  `persno_pta` varchar(11) DEFAULT NULL COMMENT 'id_sap',
  `id_petani_sap` varchar(50) DEFAULT NULL COMMENT 'id petani dari sap\r\n',
  `tebang_pg` smallint(1) DEFAULT '0' COMMENT '0 = tidak tebang pg, 1= tebang pg',
  `angkut_pg` smallint(1) DEFAULT '0' COMMENT '0 = tidak angkut pg, 1 = angkut pg',
  `jenis_spta` varchar(10) DEFAULT NULL,
  `jarak_id` int(10) DEFAULT NULL,
  `vendor_angkut` int(10) DEFAULT NULL,
  `kode_affd` varchar(11) DEFAULT NULL COMMENT 'refrens sap_m_affdeling kode',
  `kode_kat_lahan` varchar(11) DEFAULT NULL COMMENT 'refrens sap_m_kat_lahan kode',
  `kode_plant_trasnfer` varchar(5) DEFAULT NULL COMMENT 'kode pg pengirim tebu',
  `kode_plant_ke` varchar(5) DEFAULT NULL,
  `metode_tma` smallint(1) DEFAULT NULL COMMENT '1=manual,2=semi mekanisasi,3=mekanisasi',
  `ket` varchar(50) DEFAULT NULL COMMENT 'ket spta',
  `id_jenis_angkutan` int(5) DEFAULT NULL COMMENT 'mengacu pada tabel m_jenis_angkutan',
  `buat_spta_status` smallint(1) DEFAULT '0' COMMENT '0 di retur 1. di buat',
  `buat_spta_tgl` datetime DEFAULT NULL,
  `cetak_spta_status` smallint(1) DEFAULT '0' COMMENT '0,1',
  `cetak_spta_tgl` datetime DEFAULT NULL,
  `selektor_status` smallint(1) DEFAULT '0' COMMENT '0,1,2=ditolak',
  `selektor_tgl` datetime DEFAULT NULL,
  `pintu_masuk_status` smallint(1) DEFAULT '0' COMMENT '0,1',
  `pintu_masuk_tgl` datetime DEFAULT NULL,
  `timb_bruto_status` smallint(1) DEFAULT '0' COMMENT '0,1',
  `timb_bruto_tgl` datetime DEFAULT NULL,
  `timb_netto_status` smallint(1) DEFAULT '0' COMMENT '0,1',
  `timb_netto_tgl` datetime DEFAULT NULL,
  `meja_tebu_status` smallint(1) DEFAULT '0' COMMENT '0,1',
  `meja_tebu_tgl` datetime DEFAULT NULL,
  `ari_status` smallint(1) DEFAULT '0' COMMENT '0,1,2=ditolak',
  `ari_tgl` datetime DEFAULT NULL,
  `hari_giling` int(10) DEFAULT '0' COMMENT 'hari giling pabrik',
  `tgl_giling` date DEFAULT NULL,
  `no_urut_analisa_rendemen` int(10) DEFAULT '0',
  `retur_alasan` varchar(100) DEFAULT NULL,
  `retur_status` smallint(1) DEFAULT '0',
  `retur_tgl` datetime DEFAULT NULL,
  `upah_tebang_status` smallint(1) DEFAULT '0' COMMENT '0. belum 1. sudah 2. validasi 3. kirim sap',
  `upah_tebang_tgl` datetime DEFAULT NULL,
  `upah_angkut_status` smallint(1) DEFAULT '0' COMMENT '0. belum 1. sudah 2. validasi 3. sap',
  `upah_angkut_tgl` datetime DEFAULT NULL,
  `sbh_status` smallint(1) DEFAULT '0' COMMENT '0. belum 1. sudah 2. pengolahan 3. tanaman 4. AKU',
  `sbh_tgl` datetime DEFAULT NULL,
  `sbh_sap` smallint(1) DEFAULT '0',
  `sbh_sap_tgl` datetime DEFAULT NULL,
  PRIMARY KEY (`id`,`no_spat`) USING BTREE,
  UNIQUE KEY `no_spat` (`no_spat`),
  UNIQUE KEY `no_spat_2` (`no_spat`),
  UNIQUE KEY `no_spat_3` (`no_spat`),
  KEY `tgl_spat` (`tgl_spta`) USING BTREE,
  KEY `join` (`persno_pta`,`id_petani_sap`) USING BTREE,
  FULLTEXT KEY `id_petak` (`kode_blok`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC;

