  `nama_relasi` varchar(150) DEFAULT NULL COMMENT 'nama customer/suplier',
  `no_kendaraan` varchar(10) DEFAULT NULL COMMENT 'no kendaraan',
  `nama_supir` varchar(100) DEFAULT NULL COMMENT 'nama supir',
  `timbang_1` int(11) DEFAULT NULL,
  `timbang_2` int(11) DEFAULT NULL,
  `netto` int(11) DEFAULT NULL,
  `tgl_timbang_1` datetime DEFAULT NULL COMMENT 'tgl timbang',
  `tgl_timbang_2` datetime DEFAULT NULL COMMENT 'tgl timbang',
  `jenis_transaksi` enum('Penerimaan','Pengiriman') DEFAULT NULL COMMENT 'jenis transaksi PO/SO',
  `no_transaksi` varchar(50) DEFAULT NULL COMMENT 'no dokumen transaksi',
  `status_timbang_1` smallint(1) DEFAULT '0' COMMENT '0=belum 1=sudah',
  `status_timbang_2` smallint(1) DEFAULT '0' COMMENT '0=belum 1=sudah',
  `ptgs_timbang` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id_t_material`,`no_tiket`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

/*Data for the table `t_timbang_material` */

/*Table structure for table `t_timbangan` */

DROP TABLE IF EXISTS `t_timbangan`;

CREATE TABLE `t_timbangan` (
  `id_timbangan` int(11) NOT NULL AUTO_INCREMENT,
  `id_spat` int(11) NOT NULL DEFAULT '0',
  `lokasi_timbang_1` varchar(10) DEFAULT NULL COMMENT 'id_timbangan',
  `lokasi_timbang_2` varchar(10) DEFAULT NULL COMMENT 'id_timbangan',
  `bruto` int(8) DEFAULT '0',
  `tara` int(8) DEFAULT '0',
  `netto` int(8) DEFAULT '0',
  `netto_final` int(8) DEFAULT '0' COMMENT 'nilai netto akhir setelah rafaksi',
  `netto_rafaksi` int(8) DEFAULT NULL COMMENT 'nilai neto rafaksi',
  `rafaksi_prosentis` double DEFAULT '0' COMMENT 'prosentis rafaksi',
  `tgl_bruto` datetime DEFAULT NULL COMMENT 'waktu pengambilan bruto',
  `tgl_tara` datetime DEFAULT NULL COMMENT 'waktu pengambilan tara',
  `tgl_netto` datetime DEFAULT NULL COMMENT 'waktu pengambilan netto',
  `tgl_rafaksi` datetime DEFAULT NULL COMMENT 'waktu entry data rafaksi',
  `transloading_status` smallint(1) DEFAULT '0' COMMENT '0=tidak transloading,1=transloading',
  `no_transloading` varchar(10) DEFAULT NULL COMMENT 'no lori, no kontainer, no emplasement',
  `ptgs_transloading` varchar(100) DEFAULT NULL COMMENT 'nama petugas transloading',
  `ptgs_timbang_1` varchar(100) DEFAULT NULL COMMENT 'user penimbang',
  `ptgs_timbang_2` varchar(100) DEFAULT NULL COMMENT 'user penimbang',
  `tgl_transloading` datetime DEFAULT NULL COMMENT 'waktu tranloading',
  `multi_sling` varchar(100) DEFAULT NULL COMMENT 'text penyimpanan multisling',
  `netto_sebelum_koreksi` int(8) DEFAULT NULL COMMENT 'netto sebelum terjadi koreksi timbangan',
  `ket_koreksi_timbangan` text COMMENT 'keterangan penyebab koreksi',
  `train_stat` varchar(8) DEFAULT NULL COMMENT 'no trainstat',
  `no_lori` varchar(8) DEFAULT NULL COMMENT 'no lori',
  `no_loko` varchar(8) DEFAULT NULL COMMENT 'no_loko',
  PRIMARY KEY (`id_timbangan`,`id_spat`) USING BTREE,
  UNIQUE KEY `id_spat` (`id_spat`),
  UNIQUE KEY `id_spat_2` (`id_spat`),
  UNIQUE KEY `id_spat_3` (`id_spat`),
  KEY `sum` (`netto_final`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;

/*Data for the table `t_timbangan` */

/*Table structure for table `t_transaksi_material` */

DROP TABLE IF EXISTS `t_transaksi_material`;

CREATE TABLE `t_transaksi_material` (
  `id_transaksi` int(255) NOT NULL AUTO_INCREMENT,
  `no_transaksi` varchar(255) NOT NULL,
  `keterangan_transaksi` text,
  `jenis_transaksi` enum('Penerimaan','Pengiriman') DEFAULT NULL,
  PRIMARY KEY (`id_transaksi`,`no_transaksi`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `t_transaksi_material` */

/*Table structure for table `t_ubah_timbangan` */

DROP TABLE IF EXISTS `t_ubah_timbangan`;

CREATE TABLE `t_ubah_timbangan` (
  `id_ubah_timbangan` int(11) NOT NULL AUTO_INCREMENT,
  `id_spat` int(11) DEFAULT NULL,
  `no_spat` varchar(20) DEFAULT NULL,
  `no_ajuan` varchar(20) DEFAULT NULL,
  `netto_awal` int(11) DEFAULT NULL,
  `netto_perubahan` int(11) DEFAULT NULL,
  `tara_awal` int(11) DEFAULT NULL,
  `tara_perubahan` int(11) DEFAULT NULL,
  `bruto_awal` int(11) DEFAULT NULL,
  `bruto_perubahan` int(11) DEFAULT NULL,
  `tgl_perubahan` datetime DEFAULT NULL,
  `alasan_perubahan` text,
  `user_pengajuan` varchar(50) DEFAULT NULL,
  `user_validator` varchar(50) DEFAULT NULL,
  `status_validasi` smallint(1) DEFAULT '0' COMMENT '0=belum 1=sudah 2=ditolak',
  `tgl_validasi` datetime DEFAULT NULL,
  PRIMARY KEY (`id_ubah_timbangan`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

