  WHERE kat_sap = _ket_sap 
    AND `jenis_tanah_sap` LIKE CONCAT('%', TRIM(IFNULL(_jenis_tanah_sap, '')), '%') 
    AND `status_blok_sap` LIKE CONCAT('%', TRIM(IFNULL(_status_blok_sap, '')), '%');
	RETURN _kode_kat_ptp;
END */$$
